import{_ as l,a as e}from"./chunks/spracingh7extreme-bottom.DK2SsB1v.js";import{_ as r,c as a,a8 as t,o}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"SPRacingH7EXTREME (PX4 판)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/spracingh7extreme.md","filePath":"ko/flight_controller/spracingh7extreme.md"}'),s={name:"ko/flight_controller/spracingh7extreme.md"};function n(c,i,h,p,m,u){return o(),a("div",null,i[0]||(i[0]=[t('<h1 id="spracingh7extreme-px4-판" tabindex="-1">SPRacingH7EXTREME (PX4 판) <a class="header-anchor" href="#spracingh7extreme-px4-판" aria-label="Permalink to &quot;SPRacingH7EXTREME (PX4 판)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://shop.seriouslypro.com" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <a href="https://shop.seriouslypro.com/sp-racing-h7-extreme" target="_blank" rel="noreferrer">SPRacingH7EXTREME</a> is a feature packed FC/PDB with DUAL ICM20602 gyros, H7 400/480Mhz(+) CPU, high-precision BMP388 barometer, SD Card socket, current sensor, 8 easily accessible motor outputs, OSD, Microphone, Audio output, and more.</p><p>소형에서 대형 쿼드, 평면, 옥토 콥터 및 고급 프레임에 쉽게 사용할 수 있습니다. 내장형 배전판(PDB)이 특징이므로 별도의 ESC와 함께 사용하는 것이 가장 좋습니다. 4in1 ESC 배선도 쉽습니다.</p><p>4 개의 추가 모터 출력, SPI 및 UART 연결을 제공하는 12핀 스택 커넥터도 있습니다.</p><p><img src="'+l+'" alt="SPRacingH7EXTREME PCB Top"></p><p><img src="'+e+'" alt="SPRacingH7EXTREME PCB Bottom"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="주요-특징" tabindex="-1">주요 특징 <a class="header-anchor" href="#주요-특징" aria-label="Permalink to &quot;주요 특징&quot;">​</a></h2><ul><li>Main System-on-Chip: <a href="https://www.st.com/en/microcontrollers-microprocessors/stm32h750vb.html" target="_blank" rel="noreferrer">STM32H750VBT6 rev.y/v</a><ul><li>CPU: 400/480Mhz (+) ARM Cortex M7 (단정밀도 FPU 포함). (Rev V CPU 사용시 + 480Mhz)</li><li>RAM: 1MB</li><li>16MB External Flash 4-bit QuadSPI in Memory Mapped mode for code <em>and</em> config.</li></ul></li><li>내장 센서 : <ul><li>듀얼 자이로(각각 1xSPI, 별도의 인터럽트 신호 포함, 32khz 가능, fsync 가능)</li><li>고정밀 BMP388 기압계(I2C + 인터럽트)</li><li>110A 전류 센서</li></ul></li><li>외부 8핀 IO 포트를 통한 GPS.</li><li>시청각 <ul><li>온스크린 디스플레이 OSD(전용 SPI, 문자 기반, MAX7456)</li><li>마이크 센서</li><li>CPU DAC에서 오디오 출력.</li><li>마이크/DAC 출력용 오디오 믹서.</li></ul></li><li>인터페이스 <ul><li>SD 카드(1 비트 SPI가 아닌 4 비트 SDIO)</li><li>IR 트랜스폰더(iLAP 호환)</li><li>부저 회로</li><li>RSSI (아날로그/PWM)</li><li>12개의 모터 출력(모터 패드에 의해 4개, 중간에 4개, 스태킹 커넥터에 4개).</li><li>스태킹 커넥터에 대한 1x SPI 브레이크아웃</li><li>6 Serial Ports (5x TX &amp; RX, 1x TX-only bi-directional for telemetry)</li><li>부팅 버튼 (측면 누름)</li><li>바인딩/사용자 버튼 (측면 누름)</li><li>수신기 포트 (모든 일반적인 프로토콜, 인버터 필요 없음)</li><li>CAM 소켓의 CAM OSD 제어 및 비디오 입력.</li><li>SWD 디버깅 포트.</li></ul></li><li>VTX 소켓의 비디오 출력 + 오디오 출력.</li><li>OTG 기능이 있는 USB (CPU에 연결된 ID 및 VBUS)</li><li>전원 시스템 <ul><li>통합 PDB.</li><li>2-6S BEC</li><li>TVS 보호 다이오드</li><li>자이로 노이즈 필터 커패시터가 있는 자이로 전용 500ma VREG.</li><li>CPU, Baro, 마이크 등을 위한 두 번째 500ma VREG</li></ul></li><li>기타 기능 <ul><li>상태 LED</li><li>LED 스트립 지지대 (잘 배치된 연결 패드 포함).</li><li>SD 카드나 외장 플래시에서 부팅 가능.</li><li>SD 카드에서 플래시 가능.</li><li>상단 납땜 설계.</li><li>배터리 와이어용 PCB 컷아웃.</li><li>나침반 없음, GPS IO 포트에 연결된 자력계/나침반 센서가있는 외부 GPS를 사용하십시오.</li><li>Betaflight 4.x+, Cleanflight 4.x+도 실행합니다.</li><li>Cleanflight를 만든 사람인 Dominic Clifton이 디자인했습니다.</li></ul></li><li>크기 <ul><li>36x36mm with 30.5*30.5 mouting pattern, M4 holes.</li><li>소프트 마운트 M4 ~ M3 그로밋이 제공됩니다.</li></ul></li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p>The SPRacingH7EXTREME is available from the <a href="https://shop.seriouslypro.com/sp-racing-h7-extreme" target="_blank" rel="noreferrer">Seriously Pro shop</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Select the PX4 edition when purchasing!</p></div><h2 id="매뉴얼-핀배열-및-연결-다이어그램" tabindex="-1">매뉴얼, 핀배열 및 연결 다이어그램 <a class="header-anchor" href="#매뉴얼-핀배열-및-연결-다이어그램" aria-label="Permalink to &quot;매뉴얼, 핀배열 및 연결 다이어그램&quot;">​</a></h2><p>The manual with pinouts can be downloaded from <a href="http://seriouslypro.com/files/SPRacingH7EXTREME-Manual-latest.pdf" target="_blank" rel="noreferrer">here</a>. See the <a href="http://seriouslypro.com/spracingh7extreme" target="_blank" rel="noreferrer">SPRacingH7EXTREME website</a> for other diagrams.</p><h2 id="credits" tabindex="-1">Credits <a class="header-anchor" href="#credits" aria-label="Permalink to &quot;Credits&quot;">​</a></h2><p>This design was created by <a href="https://github.com/hydra" target="_blank" rel="noreferrer">Dominic Clifton</a> Initial PX4 support by <a href="https://github.com/Igor-Misic" target="_blank" rel="noreferrer">Igor-Misic</a></p>',17)]))}const g=r(s,[["render",n]]);export{P as __pageData,g as default};
